      - value: AP
        description: AGGRAVATED AND PERSISTENT
      - value: CR
        description: CAREER
      - value: EA
        description: ESPECIALLY AGGRAVATED
      - value: EM
        description: ESPECIALLY MITIGATED
      - value: HP
